def overlap(s1, e1, s2, e2):
    return not (s2 >= e1 or s1 >= e2)

class RangeModule:
    def __init__(self):
        self.root = None

    def addNode(self, root, start, end):
        def add(root, s, e):
            if s >= e:
                # cannot return none
                # e.g. [8,8) coming down to [8,9)
                # 8>=8, but there is a node here.. so return node([8,9))
                return root
            if root is None:
                root = SegmentTreeNode(start=s, end=e)
                return root

            if overlap(root.start, root.end, s, e):
                l = min(root.start, s)
                m1 = max(root.start, s)
                m2 = min(root.end, e)
                r = max(root.end, e)
                root.start = m1
                root.end = m2
                root.left = add(root.left, l, m1)
                root.right = add(root.right, m2, r)
            elif s >= root.end:
                # go to right
                root.right = add(root.right, s, e)
            else:
                root.left = add(root.left, s, e)
            return root

        return add(root, start, end)

    def addRange(self, start: int, end: int) -> None:
        self.root = self.addNode(self.root, start, end)

    def removeRange(self, start: int, end: int) -> None:
        def removeNode(root, s, e):
            if s>=e:
                return root 
            if root is None:
                return None 
            
            if overlap(root.start, root.end, s, e):
                if root.start<=start and end<=root.end:
                    # promote root.left or right to be new root
                    left = self.addNode(root.left, root.start, start)
                    right = self.addNode(root.right, end, root.end)
                elif start<=root.start and root.end<=end:
                    left = removeNode(root.left, start, root.start)
                    right = removeNode(root.right,root.end, end)
                elif start<root.start<end<=root.end:
                    left = removeNode(root.left, start, root.start)
                    right = self.addNode(root.right, end, root.end)
                else:
                    left = self.addNode(root.left, root.start, start)
                    right = removeNode(root.right,root.end, end)

                if left:
                    # cut if off then re-assign(promote)
                    # this is actually bst rebalance 
                    # ... ugh... cannot move anymore.. 
                    curr = left 
                    prev = left 
                    while curr.right:
                        prev = curr
                        curr = curr.right 
                    
                    if prev != curr:
                        prev.right = curr.left 
                        curr.left = left 
                    curr.right = right
                    root = curr
                elif right:
                    curr = right
                    prev = right 
                    while curr.left:
                        prev = curr
                        curr = curr.left 

                    if prev != curr:
                        prev.left = curr.right 
                        curr.right= right 
                    curr.left = left
                    root = curr
                else:
                    root = None
            elif s >= root.end:
                # go to right
                root.right = removeNode(root.right, s, e)
            else:
                root.left = removeNode(root.left, s, e)
            return root
        self.root = removeNode(self.root, start, end)

    def queryRange(self, start: int, end: int) -> bool:
        def helper(root, start, end):
            # deem empty range exists in this
            if start >= end:
                return True

            if root is None:
                return False

            if root.start <= start and end <= root.end:
                return True

            if start >= root.end:
                return helper(root.right, start, end)
            if end <= root.start:
                return helper(root.left, start, end)

            # overlap
            # if root range is removed, then this can return
            # otherwise, go to two ranges
            m1 = max(root.start, start)
            m2 = min(root.end, end)

            return helper(root.left, start, m1) and helper(root.right, m2, end)
        return helper(self.root, start, end)

